import React from "react";
import "./Signup.css";

function Signup() {
  return (
    <form>
      <input
        type="text"
        className="email"
        placeholder="Enter Email"
      ></input>
      <input
        type="password"
        className="password"
        placeholder="Enter Password"
      ></input>
      <button onClick={sendSignUpData}>Sign Up</button>
    </form>
  );
}

function sendSignUpData() {
  console.log("FGDHSJKAL");
}
export default Signup;
